import{_ as a,o as t,c as o,z as e,a as s}from"./chunks/framework.9482e208.js";const y=JSON.parse('{"title":"§ 58.1-210 Publication showing rates of local levies.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-210.md","filePath":"vacode/58.1-210.md"}'),n={name:"vacode/58.1-210.md"},i=e("h1",{id:"§-58-1-210-publication-showing-rates-of-local-levies",tabindex:"-1"},[s("§ 58.1-210 Publication showing rates of local levies. "),e("a",{class:"header-anchor",href:"#§-58-1-210-publication-showing-rates-of-local-levies","aria-label":'Permalink to "§ 58.1-210 Publication showing rates of local levies."'},"​")],-1),l=e("p",null,"The Department shall annually publish a pamphlet giving the then current rates of local levies. Every tax assessing officer of a county, city or town shall send to the Department, on forms to be prescribed and furnished by the Department, the information as to his county, city or town necessary to enable the Department to publish such pamphlet. Such information shall be so furnished by such tax assessing officers as soon as it is available after request by the Department. If any such assessing officer fails, without good cause, to furnish the same to the Department, on demand, he shall be guilty of nonfeasance in office. The Department shall furnish to any taxpayer, upon application in writing, a copy of such pamphlet so published.",-1),r=e("p",null,"Code 1950, § 58-47; 1984, c. 675.",-1),c=[i,l,r];function h(f,p,u,d,m,_){return t(),o("div",null,c)}const g=a(n,[["render",h]]);export{y as __pageData,g as default};
